column8:
弊社は楽天市場店の他に店頭や雑誌広告でも通信販売を行っており、<br>
タイミングによっては商品が欠品になっている可能性もあります。<br>
購入手続きが完了してもすでに完売となっている場合、納期が掛かる事をご了承ください。<br>
実際の在庫状況等については受注確認メールでご案内いたします。FJクルーザー用REAL製ステアリングの<br>
ライトブラウン仕様です。<br>
ウッド部分には8層のクリア塗装を施し、<br>
高級感を演出しています。<br>
本皮部分にはニュージーランド産の高級レザーを使用し、<br>
手に馴染む柔らかさと不用意な滑りを防ぐ手触りが特徴です。<br>
また摩擦にも強いレザーを選択し、<br>
熟練の職人が1本1本丁寧に縫い上げています。<br>
ステッチはブラウンです。<br>
レアル ステアリングは<br>
純正エアバッグに完全対応しています。<br>
エアバッグとステアリングスイッチは<br>
純正品をはずしてレアル ステアリングに付け替えてください。<br>
ご注文後にメーカーより取り寄せしますので、<br>
数日間の納期が必要です。<!-- ここから リア受 -->
